import "../styles/logPage.css";

export default function Infosuser() {
    const [inputText, setInputText] = useState("");
    function setValue(e: ChangeEvent<HTMLInputElement>) {
        setInputText(event.target.value);
    }
	return (
		<>
			<span className="password_logPage">Type your password [1337]</span>
			<div className="inputs">
				<input className="inputPassword_logPage" onChange={setValue()} />
				<div className="logoNext"></div>
			</div>
		</>
	);
}
